import React from "react";
import {Container , List} from '../style/header'

const Header = ()=>{
    return(
        <div>
            <Container>
                <ul>
                    <List>
                         <li><a href="#">Home</a></li>
                         <li>About</li>
                         <li>Contact Us</li>
                         <li>Login</li>
                    </List>
                </ul>
            </Container>
        </div>
    )
}


export default Header;
